import axios from 'axios'
import {AllMovies, allMovieAPI} from '../types/moviesType'


export const getAllMovie =  async()=>{
    const allMovie =  axios.get(allMovieAPI)

    return {type : AllMovies , data : allMovie.data.results , pages :allMovie.data.total_pages }
}
